export default function Formulario(props) {
    const cambiosInput =(e) =>{
        props.contraseña(e.target.value === props.regristro);
    }
  return (
    <React.Fragment>    
            <p>
              Desafio estado de los <br></br> componentes y eventos
            </p>
            <input type="text" placeholder="Nombre"></input>
            <br></br>
            <input type="password" placeholder="Ingresa tu password" onChange={cambiosInput} />
            <br></br>
           
    </React.Fragment>
  );
}
